import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css'
import {withRouter} from 'react-router-dom';
import * as ReactBootstrap from 'react-bootstrap';

class HeaderComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {}
    }

    addUser = () => {
        this.props.history.push('/add-user');
    }
    addStocks = () => {
        this.props.history.push('/add-stock');
    }
    addSupplier = () => {
        this.props.history.push('/add-supplier');
    }

    Users = () => {
        this.props.history.push('/users');
    }

    login = () => {
        this.props.history.push('/login');
    }

    suppliers = () => {
        this.props.history.push('/suppliers');
    }

    stocks = () => {
        this.props.history.push('/stocks');
    }

    render() {
        return (

            <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
                <ReactBootstrap.Dropdown>
                    <ReactBootstrap.Dropdown.Toggle variant="success" id="dropdown-basic">
                        Add to
                    </ReactBootstrap.Dropdown.Toggle>

                    <ReactBootstrap.Dropdown.Menu>
                        <ReactBootstrap.Dropdown.Item href="#/action-1">Action</ReactBootstrap.Dropdown.Item>
                        <ReactBootstrap.Dropdown.Item href="#/action-2">Another action</ReactBootstrap.Dropdown.Item>
                        <ReactBootstrap.Dropdown.Item href="#/action-3">Something else</ReactBootstrap.Dropdown.Item>
                    </ReactBootstrap.Dropdown.Menu>
                </ReactBootstrap.Dropdown>
                <ul className="navbar-nav">
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.addUser}>Add User</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.addStocks}>Add Stock</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.addSupplier}>Add Supplier</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.Users}>UserList</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.suppliers}>Suppliers</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.stocks}>Stocks</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" onClick={this.login}>Logout</a>
                    </li>
                </ul>
            </nav>

        );
    }
}

export default withRouter(HeaderComponent);
